<style>
    /* Needed for Internet Explorer */

    .svg-wrap {
        height:0;
        padding-top:160%;
        position: relative;
        margin:0;
    }

    svg {
        height: 100%;
        display:block;
        width: 100%;
        position: absolute;
        top:0;
        left:0;
    }

    /* etc */

    body {
        margin: 0;
        padding: 0;
    }
	html, body {margin: 0; height: 100%; overflow: hidden}
    #playactive:hover{display:none;}
    #pauseactive:hover{display:none;}

    @keyframes anuncie {
        0% { opacity: 1; }
        25% { opacity: 0; }
        50% { opacity: 0; }
        75% { opacity: 0; }
    }
    #anuncie {
        animation: anuncie 60s ease infinite;
    }
    @keyframes jarcorretora {
        0% { opacity: 0; }
        25% { opacity: 1; }
        50% { opacity: 0; }
        75% { opacity: 0; }
    }
    #jarcorretora {
        animation: jarcorretora 60s ease infinite;
    }
    @keyframes ipc {
        0% { opacity: 0; }
        25% { opacity: 0; }
        50% { opacity: 1; }
        75% { opacity: 0; }
    }
    #ipc {
        animation: ipc 60s ease infinite;
    }
    @keyframes rapidboy {
        0% { opacity: 0; }
        25% { opacity: 0; }
        50% { opacity: 0; }
        75% { opacity: 1; }
    }
    #rapidboy {
        animation: rapidboy 60s ease infinite;
    }
